"use strict";(self.webpackChunktimposu=self.webpackChunktimposu||[]).push([[1477],{10:function(a){a.exports=JSON.parse('{"blogPosts":[{"id":"alasan-menggunakan-golang-enterprise","metadata":{"permalink":"/blog/alasan-menggunakan-golang-enterprise","source":"@site/blog/2022-04-09-alasan-menggunakan-go.md","title":"5 Alasan menggunakan Golang untuk Aplikasi Enterpise","description":"Saat ini kita memiliki banyak pilihan bahasa pemrograman untuk membangun aplikasi berskala besar atau enterpise untuk skala perusahaan . Salah satu bahasa pemrograman yang mendapatkan daya tarik yang signifikan dalam beberapa tahun terakhir adalah Go atau Golang. Bahasa ini menawarkan banyak manfaat bagi bisnis dan pengembang aplikasi.","date":"2022-04-09T00:00:00.000Z","formattedDate":"April 9, 2022","tags":[{"label":"golang","permalink":"/blog/tags/golang"},{"label":"enterprise","permalink":"/blog/tags/enterprise"}],"readingTime":2.29,"truncated":true,"authors":[{"name":"Ucup TopekoX","title":"Tutorial Timposu creator","url":"https://topekox.github.io","imageURL":"https://topekox.github.io/assets/images/avatar.jpeg","key":"topekox"}],"frontMatter":{"slug":"alasan-menggunakan-golang-enterprise","title":"5 Alasan menggunakan Golang untuk Aplikasi Enterpise","authors":"topekox","tags":["golang","enterprise"]},"nextItem":{"title":"Cara Install OpenJDK 17 di MacOS","permalink":"/blog/cara-install-openjdk-17-mac"}},"content":"Saat ini kita memiliki banyak pilihan bahasa pemrograman untuk membangun aplikasi berskala besar atau enterpise untuk skala perusahaan . Salah satu bahasa pemrograman yang mendapatkan daya tarik yang signifikan dalam beberapa tahun terakhir adalah Go atau Golang. Bahasa ini menawarkan banyak manfaat bagi bisnis dan pengembang aplikasi.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\n![Golang](/img/golang/golang-logo.png \\"Golang\\")\\r\\n\\r\\nPertanyaan pertama yang muncul ketika perusahaan/startup mulai membangun aplikasi adalah Bahasa pemrograman mana yang harus dipilih?. Pilihannya pun saat ada banyak sekali seperti PHP, C#, Java, Python, JavaScript dll, dengan kelebihan dan kekurangannya sendiri. Bahasa Pemrograman Golang atau Go hadir dengan fitur yang bisa dibilang untuk menambal kekurangan pada bahasa pemrograman yang telah ada.\\r\\n\\r\\n## Mengapa Menggunakan Golang?\\r\\n\\r\\nGo atau Golang adalah bahasa pemrograman open-source yang dirancang oleh Google. Penghargaan untuk pengembangannya diberikan kepada Rob Pike, Robert Griesemer, dan Ken Thompson. Bahasa ini dirancang untuk meningkatkan kecepatan pemrograman dan mengemas yang terbaik dari banyak bahasa populer seperti pengetikan statis C++, dan Kegunaan dan Keterbacaan JavaScript. Secara sintaksis mirip dengan bahasa C tetapi dengan pengetikan struktural, pengumpulan sampah, dan keamanan memori.\\r\\n\\r\\nGolang banyak digunakan di beberapa perusahaan besar seperti Google, IBM, BBC, Apple dan Twitter dll. Melihat keberhasilan bahasa pemrograman tersebut, banyak perusahaan kecil dan menengah dan perusahaan rintisan/startup juga mulai menggunakan Go untuk pengembangan aplikasi.\\r\\n\\r\\n## Keuntungan menggunakan Golang?\\r\\n\\r\\nGolang menawarkan banyak manfaat untuk skala enterprise seperti:\\r\\n\\r\\n1. **Fleksibilitas**: Golang dapat digunakan untuk mengembangkan berbagai aplikasi mulai dari aplikasi sederhana hingga aplikasi yang kompleks pada perusahaan. Tidak hanya mampu memenuhi kebutuhan perusahaan teknologi tetapi juga industri lain seperti keuangan, media dll.\\r\\n2. **Dukungan Lintas Platform**: Perusahaan dapat menggunakan bahasa pemrograman Golang untuk membangun aplikasi lintas platform. Bahasa ini mendukung berbagai platform termasuk Windows, Linux, dan platform seluler.\\r\\n3. **Pengembangan Lebih Cepat**: Perusahaan lebih menyukai bahasa pemrograman yang membantu mereka membangun aplikasi lebih cepat. Golang dapat dikembangkan dengan cepat. Tidak ada Mesin Virtual di lingkungan Go dan kodenya langsung dikompilasi ke kode mesin, ini membuat kompilasi lebih cepat. Dengan kompiler yang memproduksi, hanya satu file yang dapat dieksekusi dan dapat diunggah dari mana saja, eksekusi kode juga menjadi cepat.\\r\\n4. **Skalabilitas**: Pertimbangan utama lainnya untuk tim pengembangan aplikasi perusahaan saat memilih bahasa pemrograman. Golang mendukung skalabilitas. Ini menggunakan fungsi dasar yang disebut *Goroutines* yang dapat berjalan secara independen dan simultan dan mandiri untuk memungkinkan penanganan banyak tugas sekaligus.\\r\\n5. **Kinerja Aplikasi**: Faktor penentu keberhasilan suatu aplikasi adalah kinerjanya. Golang menawarkan kinerja luar biasa dan pengalaman aplikasi yang menyenangkan. Membutuhkan lebih sedikit sumber daya sistem dan berjalan dengan baik pada perangkat yang lebih lama. Karena mengkonsumsi lebih sedikit RAM, aplikasi ini juga stabil dengan lebih sedikit kemungkinan aplikasi utuk crash.\\r\\n\\r\\nSelain 5 alasan di atas mengapa perusahaan harus memilih Golang, alasan lainnya adalah ketersediaan programmer Golang. Bahasanya mudah dipelajari, jadi pengembang aplikasi Anda dapat dengan cepat membangun aplikasi Golang dalamnya."},{"id":"cara-install-openjdk-17-mac","metadata":{"permalink":"/blog/cara-install-openjdk-17-mac","source":"@site/blog/2022-03-21.md","title":"Cara Install OpenJDK 17 di MacOS","description":"Di tutorial ini kita akan melakukan instalasi JDK versi opensource yaitu OpenJDK 17 di MacOS. Versi MacOs yang digunakan adalah MacOS Catalina, cara ini juga bisa juga diterapkan di MacOS versi Sierra, High Sierra, Mojave, dan Big Sur.","date":"2022-03-21T00:00:00.000Z","formattedDate":"March 21, 2022","tags":[{"label":"java","permalink":"/blog/tags/java"},{"label":"openjdk","permalink":"/blog/tags/openjdk"},{"label":"jdk","permalink":"/blog/tags/jdk"},{"label":"macos","permalink":"/blog/tags/macos"}],"readingTime":0.61,"truncated":true,"authors":[{"name":"Ucup TopekoX","title":"Tutorial Timposu creator","url":"https://topekox.github.io","imageURL":"https://topekox.github.io/assets/images/avatar.jpeg","key":"topekox"}],"frontMatter":{"slug":"cara-install-openjdk-17-mac","title":"Cara Install OpenJDK 17 di MacOS","authors":"topekox","tags":["java","openjdk","jdk","macos"]},"prevItem":{"title":"5 Alasan menggunakan Golang untuk Aplikasi Enterpise","permalink":"/blog/alasan-menggunakan-golang-enterprise"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"Di tutorial ini kita akan melakukan instalasi JDK versi opensource yaitu OpenJDK 17 di MacOS. Versi MacOs yang digunakan adalah MacOS Catalina, cara ini juga bisa juga diterapkan di MacOS versi Sierra, High Sierra, Mojave, dan Big Sur.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\n:::info\\r\\nOpenJDK adalah JDK alternatif  dari versi Oracle JDK. OpenJDK adalah distribusi JDK yang bersifat Free dan Opensource, sehingga bebas untuk digunakan, baik itu untuk penggunaan pribadi, development maupun untuk tujuan komersil. OpenJDK didistribusikan oleh Oracle dibawah lisensi [http://openjdk.java.net/legal/gplv2+ce.html](http://openjdk.java.net/legal/gplv2+ce.html) dan bisa didownload di [http://jdk.java.net/](http://jdk.java.net/).\\r\\n:::\\r\\n\\r\\n## Download OpenJDK\\r\\n\\r\\nDownload OpenJDK 17 di [http://jdk.java.net/17/](http://jdk.java.net/17/).\\r\\n\\r\\n![Download OpenJDK](/img/java/install-jdk-2.png \\"Download OpenJDK\\")\\r\\n\\r\\nKemudian download versi MacOS. File JDK yang didownload adalah file archive, kemudian file tersebut diekstrak.\\r\\n\\r\\n```bash\\r\\n# ekstrak OpenJDK\\r\\ntar -xf openjdk-17.0.2_macos-x64_bin.tar.gz\\r\\n```\\r\\n\\r\\n\\r\\n## Install JDK"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","source":"@site/blog/2022-03-20-welcome/index.md","title":"Welcome","description":"Selamat Datang di Tutorial Timposu.","date":"2022-03-20T00:00:00.000Z","formattedDate":"March 20, 2022","tags":[{"label":"facebook","permalink":"/blog/tags/facebook"},{"label":"hello","permalink":"/blog/tags/hello"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.025,"truncated":false,"authors":[{"name":"Ucup TopekoX","title":"Tutorial Timposu creator","url":"https://topekox.github.io","imageURL":"https://topekox.github.io/assets/images/avatar.jpeg","key":"topekox"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["topekox"],"tags":["facebook","hello","docusaurus"]},"prevItem":{"title":"Cara Install OpenJDK 17 di MacOS","permalink":"/blog/cara-install-openjdk-17-mac"}},"content":"Selamat Datang di Tutorial Timposu."}]}')}}]);